import React, { useState, useEffect } from "react";

function Admin() {
  const [users, setUsers] = useState([]);
  const [userId, setUserId] = useState("");
  const [photo, setPhoto] = useState(null);
  const [audio, setAudio] = useState(null);
  const [error, setError] = useState("");

  useEffect(() => {
    fetchUsers();
  }, []);

  const fetchUsers = async () => {
    try {
      const response = await fetch("https://ybg-back.vercel.app/users");
      const data = await response.json();
      setUsers(data.users);
    } catch (error) {
      console.error("Error fetching users:", error);
      setError("Failed to fetch users");
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const formData = new FormData();
    formData.append("user_id", userId);
    if (photo) formData.append("photo", photo);
    if (audio) formData.append("audio", audio);

    try {
      const response = await fetch("https://ybg-back.vercel.app/admin", {
        method: "POST",
        body: formData,
      });
      const data = await response.json();
      
      if (response.ok) {
        alert(data.message);
        fetchUsers(); // Refresh user list
      } else {
        setError(data.error);
      }
    } catch (error) {
      console.error("Error:", error);
      setError("Failed to submit files");
    }
  };

  const downloadFile = async (userId, fileType) => {
    try {
      const response = await fetch(`https://ybg-back.vercel.app/user/${userId}/${fileType}`);
      if (!response.ok) {
        throw new Error(`No ${fileType} found`);
      }
      const blob = await response.blob();
      const url = window.URL.createObjectURL(blob);
      const a = document.createElement('a');
      a.href = url;
      a.download = `user_${userId}_${fileType}`;
      document.body.appendChild(a);
      a.click();
      window.URL.revokeObjectURL(url);
      document.body.removeChild(a);
    } catch (error) {
      console.error(`Error downloading ${fileType}:`, error);
      alert(`Failed to download ${fileType}`);
    }
  };

  return (
    <div style={{ padding: "20px", maxWidth: "800px", margin: "0 auto" }}>
      <h1>Admin Dashboard</h1>
      
      {error && <div style={{ color: 'red', marginBottom: '10px' }}>{error}</div>}
      
      <form onSubmit={handleSubmit} style={{ 
        display: 'flex', 
        flexDirection: 'column', 
        gap: '10px', 
        marginBottom: '20px' 
      }}>
        <select 
          value={userId} 
          onChange={(e) => setUserId(e.target.value)}
          required
        >
          <option value="">Select User</option>
          {users.map(user => (
            <option key={user.id} value={user.id}>
              {user.name} {user.surname} (#{user.player_number})
            </option>
          ))}
        </select>
        
        <input
          type="file"
          accept="image/*"
          onChange={(e) => setPhoto(e.target.files[0])}
          placeholder="Upload Photo"
        />
        
        <input
          type="file"
          accept="audio/*"
          onChange={(e) => setAudio(e.target.files[0])}
          placeholder="Upload Audio"
        />
        
        <button type="submit">Submit Files</button>
      </form>

      <h2>Users List</h2>
      <table style={{ width: '100%', borderCollapse: 'collapse' }}>
        <thead>
          <tr style={{ backgroundColor: '#f2f2f2' }}>
            <th style={{ border: '1px solid #ddd', padding: '8px' }}>Name</th>
            <th style={{ border: '1px solid #ddd', padding: '8px' }}>Player #</th>
            <th style={{ border: '1px solid #ddd', padding: '8px' }}>Photo</th>
            <th style={{ border: '1px solid #ddd', padding: '8px' }}>Audio</th>
            <th style={{ border: '1px solid #ddd', padding: '8px' }}>Actions</th>
          </tr>
        </thead>
        <tbody>
          {users.map(user => (
            <tr key={user.id}>
              <td style={{ border: '1px solid #ddd', padding: '8px' }}>
                {user.name} {user.surname}
              </td>
              <td style={{ border: '1px solid #ddd', padding: '8px', textAlign: 'center' }}>
                {user.player_number}
              </td>
              <td style={{ border: '1px solid #ddd', padding: '8px', textAlign: 'center' }}>
                {user.has_photo ? '✓' : '✗'}
              </td>
              <td style={{ border: '1px solid #ddd', padding: '8px', textAlign: 'center' }}>
                {user.has_audio ? '✓' : '✗'}
              </td>
              <td style={{ border: '1px solid #ddd', padding: '8px', textAlign: 'center' }}>
                {user.has_photo && (
                  <button onClick={() => downloadFile(user.id, 'photo')}>
                    Download Photo
                  </button>
                )}
                {user.has_audio && (
                  <button onClick={() => downloadFile(user.id, 'audio')}>
                    Download Audio
                  </button>
                )}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default Admin;
